import Home from '../views/Home.vue'
import About from '../views/About.vue'
import Award from '../views/Award.vue'
import Education from '../views/Education.vue'
import Skills from '../views/Skills.vue'
const routes = [
    {
        path: '/home',
        name: 'home',
        component: Home
    },
    {
        path: '/about',
        name: 'about',
        component: About
    },
    {
        path: '/award',
        name: 'award',
        component: Award
    },
    {
        path: '/education',
        name: 'education',
        component: Education
    },
    {
        path: '/skills',
        name: 'skills',
        component: Skills
    },
    {
        path: '/',
        redirect: '/welcome'
    }
]
export default routes
